*
 * 打开客户端  书籍相关的评论页 /书评区
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 * @param {string} params.bookId - 书籍Id
 *
 * @returns {Promise<*>}
 *
 * @example 调用示例
 * libSQ.exec('open-book-comment-list',{ params: {bookId: 6905672} }).then(function (info) {
 *   alert('[from ready][open-book-comment-list][then] ' + JSON.stringify(info, null, 2));
 * }).catch(function (err) {
 *   alert('[from ready][open-book-comment-list][error] ' + JSON.stringify(err, null, 2));
 * });
 *
 * * 评论列表客户端需要使用特定的webview打开，测试时需要改掉url，从书籍封面进入，根据param拼接成url正确即可
 * todo: android的方法根据type不同可打开评论列表和评论详情，未测试。
 * ! aya项目不存在openCommentPage用于打开列表页的使用，仅android

